import logo from './logo.svg';
import React from 'react';
import './App.css';

function App() {
  const handleClick = () => {
    // Add any functionality you want when the button is clicked
    console.log('Button clicked!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <div>
          <h1>Welcome</h1>
          <button onClick={handleClick}>Start</button>
        </div>
      </header>
    </div>
  );
}

export default App;
